import React from 'react';

const Inventory: React.FC = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Inventory</h1>
        <p className="text-gray-600">Track stock levels and manage warehouses.</p>
      </div>

      <div className="card p-8 text-center">
        <h3 className="text-lg font-medium text-gray-900 mb-2">Inventory Management</h3>
        <p className="text-gray-600">This module will include stock tracking, warehouse management, and inventory reports.</p>
      </div>
    </div>
  );
};

export default Inventory;
